import { 
  addNewBlockBoundary,
  moveBoundary,
  moveTimeline,
  showBlockMaker,
} from './actions';

export default module => {

  // Default stuff for the state:
  module.addState({
    bgimage: 'data:image/png;base64,',
    timelines: [
      { y: 153, time: 2 },
      { y: 328, time: 7 },
      { y: 531, time: 15 },
    ],
    boundaries: [],
	displayBlock: false,
  });

  // Signals:
  module.addSignals({
    newBlockBoundaryRequested: [ addNewBlockBoundary ],
    boundaryMoveRequested: [ moveBoundary ],
    timelineMoveRequested: [ moveTimeline ],
	showBlockMakerRequested: [ showBlockMaker],
  });


};
